using System;
using System.Collections.Generic;
using System.Linq;
using System.Threading.Tasks;
using Elasticsearch.Net;
using FluentAssertions;
using Nest;
using Newtonsoft.Json.Linq;
using Tests.Framework;
using Tests.Framework.Integration;
using Tests.Framework.MockData;
using Xunit;
using System.IO;

namespace Tests.Document.Single.Index
{
	public class Document
	{
		public Attachment Attachment { get; set; }
	}

	[Collection(IntegrationContext.Indexing)]
	public abstract class AttachmentApiTestsBase :
		ApiIntegrationTestBase<IIndexResponse, IIndexRequest<Document>, IndexDescriptor<Document>, IndexRequest<Document>>
	{
		// Base 64 encoded version of Attachment_Test_Document.pdf
		protected static readonly string Content =
			"";

		protected virtual Document Document =>
			new Document { Attachment = new Attachment { Content = Content } };

		protected virtual Document ModifyDocument(Document document) => document;

		protected AttachmentApiTestsBase(IndexingCluster cluster, EndpointUsage usage) : base(cluster, usage)
		{
		}

		protected override void IntegrationSetup(IElasticClient client, CallUniqueValues values)
		{
			foreach (var callUniqueValue in values)
			{
				var indexResponse = this.Client.CreateIndex(callUniqueValue.Value, c => c
					.Mappings(m => m
						.Map<Document>(mm => mm
							.Properties(p => p
								.Attachment(a => a
									.Name(n => n.Attachment)
									.AuthorField(d => d
										.Name(n => n.Attachment.Author)
									)
									.FileField(d => d
										.Name(n => n.Attachment.Content)
									)
									.ContentLengthField((NumberPropertyDescriptor<Document> d) => d
										.Name(n => n.Attachment.ContentLength)
									)
									.ContentTypeField(d => d
										.Name(n => n.Attachment.ContentType)
										.Store()
									)
									.DateField(d => d
										.Name(n => n.Attachment.Date)
									)
									.KeywordsField(d => d
										.Name(n => n.Attachment.Keywords)
										.Store()
									)
									.LanguageField((StringPropertyDescriptor<Document> d) => d
										.Name(n => n.Attachment.Language)
										.Store()
									)
									.NameField(d => d
										.Name(n => n.Attachment.Name)
										.Store()
									)
									.TitleField(d => d
										.Name(n => n.Attachment.Title)
										.Store()
									)
								)
							)
						)
					)
				);

				if (!indexResponse.IsValid)
				{
					throw new Exception("Could not set up attachment index for test");
				}
			}
		}

		protected override LazyResponses ClientUsage() => Calls(
			fluent: (client, f) => client.Index(this.Document, f),
			fluentAsync: (client, f) => client.IndexAsync(this.Document, f),
			request: (client, r) => client.Index(r),
			requestAsync: (client, r) => client.IndexAsync(r)
			);

		protected override bool ExpectIsValid => true;
		protected override int ExpectStatusCode => 201;
		protected override HttpMethod HttpMethod => HttpMethod.PUT;

		protected override string UrlPath
			=> $"/{CallIsolatedValue}/document/{CallIsolatedValue}?refresh=true";

		protected override bool SupportsDeserialization => false;

		protected override IndexDescriptor<Document> NewDescriptor() => new IndexDescriptor<Document>(this.Document);

		protected override Func<IndexDescriptor<Document>, IIndexRequest<Document>> Fluent => s => s
			.Index(CallIsolatedValue)
			.Id(CallIsolatedValue)
			.Refresh();

		protected override IndexRequest<Document> Initializer =>
			new IndexRequest<Document>(this.Document, CallIsolatedValue, id: CallIsolatedValue)
			{
				Refresh = true,
			};

		protected override void ExpectResponse(IIndexResponse response)
		{
			response.IsValid.Should().BeTrue();

			var searchResponse = Client.Search<Document>(s => s
				.Index(CallIsolatedValue)
				.Query(q => q
					.Match(m => m
						.Field(a => a.Attachment.Content)
						.Query("NEST mapper")
					)
				)
			);

			searchResponse.IsValid.Should().BeTrue();
			searchResponse.Documents.Count().Should().Be(1);
		}
	}

	[Collection(IntegrationContext.Indexing)]
	public class AttachmentApiTests : AttachmentApiTestsBase
	{

		public AttachmentApiTests(IndexingCluster cluster, EndpointUsage usage) : base(cluster, usage)
		{
		}

		protected override object ExpectJson =>
			new
			{
				attachment = Content
			};

		protected override void ExpectResponse(IIndexResponse response)
		{
			response.IsValid.Should().BeTrue();

			var searchResponse = Client.Search<Document>(s => s
				.Index(CallIsolatedValue)
				.Query(q => q
					.Match(m => m
						.Field(a => a.Attachment.Content)
						.Query("NEST mapper")
					)
				)
			);

			searchResponse.IsValid.Should().BeTrue();
			searchResponse.Documents.Count().Should().Be(1);

			searchResponse = Client.Search<Document>(s => s
				.Index(CallIsolatedValue)
				.Fields(f => f.Field(d => d.Attachment.ContentType))
				.Query(q => q
					.MatchAll()
				)
			);

			searchResponse.IsValid.Should().BeTrue();
			searchResponse.Documents.Count().Should().Be(1);

			// mapper attachment extracts content type
			searchResponse.Hits.First()
				.Fields
				.ValueOf<Document, string>(d => d.Attachment.ContentType)
				.Should().Be("application/pdf");
		}
	}

	[Collection(IntegrationContext.Indexing)]
	public class AttachmentWithMetadataApiTests : AttachmentApiTestsBase
	{
		protected override Document Document =>
			new Document
			{
				Attachment = new Attachment
				{
					ContentType = "application/pdf",
					Content = Content,
					Name = "content name",
					// in order to explicitly send language metadata,
					// detect_language also needs to be set to true
					Language = "en",
					DetectLanguage = true
				}
			};

		public AttachmentWithMetadataApiTests(IndexingCluster cluster, EndpointUsage usage) : base(cluster, usage)
		{
		}

		protected override object ExpectJson =>
			new
			{
				attachment = new
				{
					_content = Content,
					_content_type = "application/pdf",
					_name = "content name",
					_language = "en",
					_detect_language = true
				}
			};

		protected override void ExpectResponse(IIndexResponse response)
		{
			response.IsValid.Should().BeTrue();

			var searchResponse = Client.Search<Document>(s => s
				.Index(CallIsolatedValue)
				.Query(q => q
					.Match(m => m
						.Field(a => a.Attachment.Name)
						.Query("name")
					)
				)
			);

			searchResponse.IsValid.Should().BeTrue();
			searchResponse.Documents.Count().Should().Be(1);

			searchResponse = Client.Search<Document>(s => s
				.Index(CallIsolatedValue)
				.Query(q => q
					.Match(m => m
						.Field(a => a.Attachment.ContentType)
						.Query("pdf")
					)
				)
			);

			searchResponse.IsValid.Should().BeTrue();
			searchResponse.Documents.Count().Should().Be(1);

			searchResponse = Client.Search<Document>(s => s
				.Index(CallIsolatedValue)
				.Query(q => q
					.Match(m => m
						.Field(a => a.Attachment.Language)
						.Query("en")
					)
				)
			);

			searchResponse.IsValid.Should().BeTrue();
			searchResponse.Documents.Count().Should().Be(1);
		}
	}
}
